import React from "react";
import {Route, BrowserRouter,} from "react-router-dom";

import HomePage from "./pages/HomePage";
import ListaContatos from "./pages/ListaContatos";
import DetalheContato from "./pages/DetalheContato";


const Routes = () => {
    return (
        <BrowserRouter>
            <Route exact path ="/" component = {HomePage} />
            <Route exact path = "/lista-contatos" component = {ListaContatos} />
            <Route exact path = "/detalhe-contato" component = {DetalheContato} />
        </BrowserRouter>

    );

}

export default Routes;
